import React, { Component } from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Footer from "./components/Footer";
import AuthService from "./services/auth.service";
import Team from "./components/Team";
import Login from "./components/login.component";
import Register from "./components/register.component";
import Home from "./components/Home.component";
import Profile from "./components/profile.component";
import BoardUser from "./components/board-user.component";
import Addcomponent from "./components/Addcomponent";
import BoardAdmin from "./components/board-admin.component";
import companyLogo from "./images/logo.gif";
// import AuthVerify from "./common/auth-verify";
import EventBus from "./common/EventBus";

class App extends Component {
  constructor(props) {
    super(props);
    this.logOut = this.logOut.bind(this);

    this.state = {
      showModeratorBoard: false,
      showAdminBoard: false,
      currentUser: undefined,
    };
  }

  componentDidMount() {
    const user = AuthService.getCurrentUser();

    if (user) {
      this.setState({
        currentUser: user,
        showModeratorBoard: user.roles.includes("ROLE_MODERATOR"),
        showAdminBoard: user.roles.includes("ROLE_ADMIN"),
      });
    }

    EventBus.on("logout", () => {
      this.logOut();
    });
  }

  componentWillUnmount() {
    EventBus.remove("logout");
  }

  logOut() {
    AuthService.logout();
    this.setState({
      showModeratorBoard: false,
      showAdminBoard: false,
      currentUser: undefined,
    });
  }

  render() {
    const { currentUser, showAdminBoard } = this.state;

    return (
      <>
      <div>
        <nav className="navbar navbar-expand-lg navbar navbar-light"
        data-spy="affix"
        data-offset-top="197" >

          <img src={companyLogo} alt="logo" height={80} />
          <Link to={"/"} className="navbar-brand">
          E-Waste Collection
          </Link>
          <div className="navbar-nav mr-auto">
            <li className="nav-item">
            <button type="button" className="btn btn-success btn-sm ml-1">
              <Link to={"/home"} className="nav-link">
                Home
              </Link>
              </button>
            </li>
            {showAdminBoard && (
              <li className="nav-item">
                <button type="button" className="btn btn-success btn-sm ml-1">
                <Link to={"/admin"} className="nav-link">
                  Admin Board
                </Link></button>
              </li>
            )}

            {currentUser && (
              <li className="nav-item">
                <button type="button" className="btn btn-success btn-sm ml-1">
                <Link to={"/user"} className="nav-link">
                  DashBoard
                </Link></button>
              </li>
            )}
          </div>

          {currentUser ? (
            <div className="navbar-nav ml-auto">
              <li className="nav-item">
              <button type="button" className="btn btn-outline-success btn-sm ml-1">
                <Link to={"/profile"} className="nav-link">
                  {currentUser.username}
                </Link></button>
              </li>
              <li className="nav-item">
              <button type="button" className="btn btn-outline-success btn-sm ml-1">
                <a href="/login" className="nav-link" onClick={this.logOut}>
                  LogOut
                </a></button>
              </li>
            </div>
          ) : (
            <div className="navbar-nav ml-auto">
              <li className="nav-item">
              <button type="button" className="btn btn-outline-success btn-sm ml-1">
                <Link to={"/login"} className="nav-link">
                  Login
                </Link></button>
              </li>

              <li className="nav-item">
              <button type="button" className="btn btn-outline-success btn-sm ml-1">
                <Link to={"/register"} className="nav-link">
                  Sign Up
                </Link></button>
              </li>
              <li className="nav-item">
              <button type="button" className="btn btn-outline-success btn-sm ml-1">
                <Link to={"/team"} className="nav-link">
                  Meet Team
                </Link></button>
              </li>


            </div>
          )}
        </nav>

        <div className="container mt-3">
          <Switch>
            <Route exact path={["/", "/home"]} component={Home} />
            <Route exact path="/login" component={Login} />
            <Route exact path="/register" component={Register} />
            <Route exact path="/profile" component={Profile} />
            <Route path="/user" component={BoardUser} />
            <Route path="/mod" component={Addcomponent} />
            <Route path="/admin" component={BoardAdmin} />
            <Route path="/team" element={<Team />} />
          </Switch>
        </div>

        { /*<AuthVerify logOut={this.logOut}/> */ }
      </div>
       <Footer/></>
    );
  }
}

export default App;
